import React from "react";
import { Dropdown, CloseButton } from 'react-bootstrap';
import './menustyle.css';



function Menu() {
	
   
    return (
        
        <Dropdown>
            <CloseButton />
        <Dropdown.Toggle variant="success" id="dropdown-basic">
          Menu
        </Dropdown.Toggle>
        
        <Dropdown.Menu>
          <Dropdown.Item href="#/Nosotros">Nosotros</Dropdown.Item>
          <Dropdown.Item href="#/Servicios">servicios</Dropdown.Item>
          <Dropdown.Item href="#/Contacto">Contacto</Dropdown.Item>
        </Dropdown.Menu>
        </Dropdown>
        
        
    );
}

export default Menu;
